                        <Col md='6'>
                            <Row>
                                <Col md="4">
                                    <img src="" alt=""/>
                                </Col>
                                <Col md="4"></Col>
                            </Row>
                        </Col>
                        <Col md='6'>

                        </Col>
                    </Row>
                </Container>
            </section>)
    }
}

export default Sosmed;
